import React from 'react'
import { Link } from 'react-router-dom'

function BlogPrevNext() {
  return (
    <div className="next-prev-blog">
      <Link to="" className="btn">Previous Post</Link> <Link href="#" className="btn">Next Post</Link>
    </div>
  )
}

export default BlogPrevNext
